('2', '1', '2017-03-19 10:57:24', '2017-03-19 13:57:24', '<p>Esta é uma página de exemplo. É diferente de um post porque ela ficará em um local e será exibida na navegação do seu site (na maioria dos temas). A maioria das pessoas começa com uma página de introdução aos potenciais visitantes do site. Ela pode ser assim:</p>\n<blockquote>\n<p>Olá! Eu sou um bike courrier de dia, ator amador à noite e este é meu blog. Eu moro em São Paulo, tenho um cachorro chamado Tonico e eu gosto de caipirinhas. (E de ser pego pela chuva.)</p>\n</blockquote>\n<p>ou assim:</p>\n<blockquote>\n<p>A XYZ foi fundada em 1971 e desde então vem proporcionando produtos de qualidade a seus clientes. Localizada em Valinhos, XYZ emprega mais de 2.000 pessoas e faz várias contribuições para a comunidade local.</p>\n</blockquote>\n<p>Como um novo usuário do WordPress, você deve ir até o <a href=\"http://rede.com.br/wp-admin/\">seu painel</a> para excluir essa página e criar novas páginas com seu próprio conteúdo. Divirta-se!</p>\n\n<!-- wp:cover-image {\"url\":\"http://rede.com.br/wp-content/uploads/2018/03/Copy-of-Customer-Appreciation-e1521313068387.jpg\",\"id\":33} -->\n<div class=\"wp-block-cover-image has-background-dim\" style=\"background-image:url(http://rede.com.br/wp-content/uploads/2018/03/Copy-of-Customer-Appreciation-e1521313068387.jpg)\">\n    <p class=\"wp-block-cover-image-text\"><strong>﻿Promoção do locão!<del>﻿</del></strong></p>\n</div>\n<!-- /wp:cover-image -->\n\n<!-- wp:latest-posts {\"layout\":\"grid\"} /-->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote {\"layout\":\"grid\"} -->\n<blockquote class=\"wp-block-quote layout-grid\">\n    <p>vfgvdfdf</p>\n</blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:button -->\n<div class=\"wp-block-button alignnone\"><a class=\"wp-block-button__link\" href=\"www.algumlugar.com.br\">Ver todos</a></div>\n<!-- /wp:button -->', 'Página de Exemplo', '', 'publish', 'closed', 'open', '', 'pagina-exemplo', '', '', '2018-03-17 16:13:41', '2018-03-17 19:13:41', '', '0', 'http://rede.com.br/?page_id=2', '0', 'page', '', '0'),
