('39', '1', '2018-03-17 15:54:48', '2018-03-17 18:54:48', '<p>Esta é uma página de exemplo. É diferente de um post porque ela ficará em um local e será exibida na navegação do seu site (na maioria dos temas). A maioria das pessoas começa com uma página de introdução aos potenciais visitantes do site. Ela pode ser assim:</p>\n<blockquote><p>Olá! Eu sou um bike courrier de dia, ator amador à noite e este é meu blog. Eu moro em São Paulo, tenho um cachorro chamado Tonico e eu gosto de caipirinhas. (E de ser pego pela chuva.)</p></blockquote>\n<p>ou assim:</p>\n<blockquote><p>A XYZ foi fundada em 1971 e desde então vem proporcionando produtos de qualidade a seus clientes. Localizada em Valinhos, XYZ emprega mais de 2.000 pessoas e faz várias contribuições para a comunidade local.</p></blockquote>\n<p>Como um novo usuário do WordPress, você deve ir até o <a href=\"http://rede.com.br/wp-admin/\">seu painel</a> para excluir essa página e criar novas páginas com seu próprio conteúdo. Divirta-se!</p>\n\n<!-- wp:cover-image -->\n<div class=\"wp-block-cover-image has-background-dim\">\n    <p class=\"wp-block-cover-image-text\"><strong>﻿Promoção do locão!<del>﻿</del></strong></p>\n</div>\n<!-- /wp:cover-image -->', 'Página de Exemplo', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2018-03-17 15:54:48', '2018-03-17 18:54:48', '', '2', 'http://rede.com.br/2018/03/17/2-revision-v1/', '0', 'revision', '', '0'),
