('568', '1', '2018-04-04 23:23:24', '2018-04-05 02:23:24', 'O resultado do balanço do segundo trimestre da Petrobras confirma a tendência que o movimento petroleiro vem denunciando. A direção da Petrobras, combinada com o Governo Temer, está abandonando a produção nacional e estatal de derivados de petróleo.\r\n\r\nO principal destaque nesse sentido está descrito abaixo:\r\n\r\n<i><b>No 1S-2017, a produção de derivados no Brasil apresentou queda de 7{8fa6de1103ec803dc2d2174c16a827070816dd6eaf3a7afb8525f69b30b6684e} quando comparado ao 1S-2016, totalizando 1.805 mil barris por dia (bpd), enquanto as vendas de derivados no mercado doméstico atingiram 1.943 mil bpd, uma queda de 7{8fa6de1103ec803dc2d2174c16a827070816dd6eaf3a7afb8525f69b30b6684e}.</b></i>\r\n\r\nA produção no Brasil de derivados, onde as refinarias da Petrobras correspondem a 98{8fa6de1103ec803dc2d2174c16a827070816dd6eaf3a7afb8525f69b30b6684e} de tudo que é produzido, vem perdendo espaço para as refinarias estrangeiras. Só esse ano o volume de derivados de petróleo importados chegou a um valor de um pouco mais de 18 bilhões de litros em seis meses, ou aproximadamente 622 mil barris por dia de derivados. Na tabela abaixo é possível ver a importação de <a href=\"http://www.anp.gov.br/wwwanp/dados-estatisticos\">derivados divulgada mensalmente pela Agência Nacional de Petróleo (ANP)</a>, em metros cúbicos (m3):\r\n\r\n<a href=\"http://esquerdaonline.com.br/wp-content/uploads/2017/08/m3.png\"><img class=\"aligncenter size-full wp-image-17644\" src=\"http://esquerdaonline.com.br/wp-content/uploads/2017/08/m3.png\" sizes=\"(max-width: 461px) 100vw, 461px\" srcset=\"https://novodev.brasa.art.br/esquerdaonline/wp-content/uploads/2017/08/m3.png 461w, https://novodev.brasa.art.br/esquerdaonline/wp-content/uploads/2017/08/m3-300x175.png 300w\" alt=\"m3\" width=\"461\" height=\"269\" /></a>\r\nEnquanto isso, a produção das refinarias brasileiras nos últimos 12 meses ficaram numa faixa de 75{8fa6de1103ec803dc2d2174c16a827070816dd6eaf3a7afb8525f69b30b6684e}. É importante lembrar que a RNEST, em Pernambuco, e o COMPERJ, no Rio de Janeiro, estão com 80{8fa6de1103ec803dc2d2174c16a827070816dd6eaf3a7afb8525f69b30b6684e} das obras concluídas, o que pode ajudar o País na perspectiva da auto-suficiência de derivados, como os combustíveis, trazendo mais soberania, direitos e renda para o povo pobre e trabalhador.\r\n\r\nA dupla Temer e Parente, presidente da Petrobras, está privatizando as nossas riquezas naturais e o patrimônio brasileiro. A passos largos estão abrindo mão do refino de petróleo, da produção estatal de petróleo e gás e da própria Petrobras, boicotando a maior empresa brasileira. É preciso dar um basta.\r\n\r\nPor tudo isso, estamos intensificando a luta pelo Fora Temer e para que ele leve o Parente junto. Também, contra o desmonte da Petrobras e em defesa dos empregos. Exigimos que não sejam vendidos os ativos e que não haja abertura de capital das Refinarias. Ainda, lutamos pela conclusão das obras do COMPERJ e RNEST, já.', 'Officia eaque asperiores nihil deleniti nihil dolores', 'Ea voluptas aut dolor magnam tenetur sint harum totam molestias quis sint sint neque perferendis maxime accusamus illo minima qui dolores et officia ipsa voluptatem rem culpa voluptate ullam fugit laudantium eius id sed rerum placeat illo distinctio saepe occaecati nisi laudantium dicta dicta dolore facilis animi aut fugit laborum error ducimus laudantium et expedita in a eos et magnam nihil autem corrupti sequi facere.\r\n\r\nOmnis commodi asperiores nulla recusandae voluptatem suscipit nostrum modi sit rem nam qui perferendis amet voluptas cupiditate necessitatibus molestiae nesciunt omnis quia temporibus ad debitis corrupti eveniet ipsam aut ut id eius voluptatem accusamus voluptatum autem consequatur eum voluptatum pariatur autem eius commodi totam et optio.', 'publish', 'open', 'open', '', 'officia-eaque-asperiores-nihil-deleniti-nihil-dolores', '', '', '2018-04-11 15:27:03', '2018-04-11 18:27:03', '', '0', 'http://rede.com.br/?p=568', '0', 'post', '', '0'),
